import React from 'react';
import { useDrag } from 'react-dnd';

const DraggableEvent = ({ entry, onDelete, onEdit }) => {
    const [{ isDragging }, drag] = useDrag(() => ({
        type: 'EVENT',
        item: { id: entry._id, date: entry.date },
        collect: (monitor) => ({
            isDragging: !!monitor.isDragging(),
        }),
    }), [entry]);

    return (
        <div
            ref={drag}
            style={{ opacity: isDragging ? 0.5 : 1 }}
            className="eventContainer"
        >
            <h2 className="eventHeaderTitle">{entry.title}</h2>
            <p className="eventDescription">{entry.description}</p>
            <button className="deleteButton" onClick={() => onDelete(entry._id)}>Delete</button>
            <button className="editButton" onClick={() => onEdit(entry)}>Edit</button>
        </div>
    );
};

export default DraggableEvent;
